import React, { Component } from "react";

export default class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      logged: false
    }
  }

  render() {
    return (
      <div className="App">
      {
        this.state.logged ? <Logged /> : <Desloged />
      }
      </div>
    );
  }
}
